import "./NewRow.css";
const NewRow = () => {
    return(
        <div className="container">
            <div className="col">
                <label>Item</label>
                <input type="text"></input>
                <input type="text"></input>
            </div>
            <div className="col">
                <label>QTY</label>
                <input type="number"></input>
            </div>
            <div className="col">
                <label>Price/Rate</label>
                <input type="text"></input>
            </div>
            <div className="col">
                <label>Action</label>
                <h5> delete </h5>
            </div>
        </div>
    );
}

export default NewRow;
